import { Grid, Box,Paper, Typography } from '@mui/material'
import React from 'react'

const Edit_profile = () => {
  return (
    <div>
        <Grid
        container
        direction="row"
        justifyContent="center"
        alignItems="center"
        style={{
            border:'2px solid red'
        }}>
            <Paper variant="outlined" square style={{
                width:'50vh'
            }}>

            </Paper>

        

        </Grid>
    </div>
  )
}

export default Edit_profile
